description:
"One, two,
Buckle my shoe;
Three, four,
Knock on  the door;
Five, six,
Pick up sticks;
Seven, eight,
Lay them straight:
Nine, ten,
A big, fat hen;
Eleven, twelve,
Dig and delve;
Thirteen, fourteen,
Maids a-courting;
Fifteen, sixteen,
Maids in the kitchen;
Seventeen, eighteen,
Maids a-waiting
Nineteen, twenty,
My plate's empty.'
